import React from 'react'
import "../styles/service1_1.css"


class Multiplechkbox extends React.Component{
    render(){
        return(
        
        <div  style={{
            position: 'relative',
            left: '50%',
                    }}> 
            
            <table>
<tr><td><input type="checkbox" name="Propaganda 1"/> <mark id="propaganda1">Propaganda 1&nbsp;&nbsp;</mark></td></tr>
<tr><td><input type="checkbox" name="Propaganda 2"/> Propaganda 2&nbsp;&nbsp;</td></tr>
<tr><td><input type="checkbox" name="Propaganda 3"/> Propaganda 3&nbsp;&nbsp;</td></tr>

</table>
                
               
           

           

        </div>);
    }


}
export default Multiplechkbox;
